import React from 'react';

class Femi extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            isLogIn: false
        }
        this.handleChange = this.handleChange.bind(this)
    }
    handleChange() {
        this.setState({isLogIn: !isLogIn})
    }
    render(){
        return(
            <div>
                <button type="button" onClick={this.handleChange}>LoGIN</button>
            </div>
        )
    }
}


export default Femi
